<script>
  $(function(){
    $('.megakassa-payment-method').click(function(){
      let paymentMethod = $(this).attr('data-id');
      let signature = $(this).attr('data-sign');
      $('input[name=method_id]').val(paymentMethod);
      $('input[name=signature').val(signature);
      $(this).parents('form').submit();
    });
  });
</script>
